import React from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

const App = () => {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<div>Home Page</div>}/>
      <Route path='login' element={<div>Login</div>}/>
      <Route path='register' element={<div>Register</div>}/>
    </Routes>
    </BrowserRouter>
  );
};

export default App;
